[include led_effects.cfg]
[include speed_test.cfg]
[include KAMP_Settings.cfg]
[include scanner.cfg]
[include bed_calibration.cfg]
[include pause_resume_cancel.cfg]
[include fans.cfg]

# MCU Configuration
[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32h723xx_230005000351323336333538-if00


[display_status]

[printer]
kinematics: corexy
max_velocity: 535  # Maximum speed in mm/s, adjust based on your setup
max_accel: 26000  # Maximum acceleration in mm/s^2, adjust as needed
max_z_velocity: 30  # Maximum Z-axis speed in mm/s
max_z_accel: 200  # Maximum Z-axis acceleration in mm/s^2

[adxl345]
cs_pin: scanner:PA3
spi_bus: spi1

[resonance_tester]
accel_chip: adxl345
probe_points:
    125, 125, 20


[stepper_x] #SLOT M3
step_pin: PE14
dir_pin: PE8
enable_pin: !PE9
rotation_distance: 40
microsteps: 32
full_steps_per_rotation: 400


endstop_pin: PG11               
position_endstop: -0
position_min: 0
position_max: 505
homing_speed: 200  
homing_retract_dist: 50

[tmc5160 stepper_x]
cs_pin: PE7
interpolate: false
run_current: 1.9
sense_resistor: 0.033
spi_software_mosi_pin: PB5
spi_software_miso_pin: PB4
spi_software_sclk_pin: PB3
driver_TBL: 2
driver_TOFF: 4
driver_DISS2G: 1
driver_DISS2VS: 1


[stepper_x1] # SLOT M5
step_pin: PE1
dir_pin: !PF0
enable_pin: !PC15
rotation_distance: 40
microsteps: 32
full_steps_per_rotation: 400  


[tmc5160 stepper_x1] 
cs_pin: PF1
interpolate: false
run_current: 1.9
sense_resistor: 0.033
spi_software_mosi_pin: PB5
spi_software_miso_pin: PB4
spi_software_sclk_pin: PB3
driver_TBL: 2
driver_TOFF: 4
driver_DISS2G: 1
driver_DISS2VS: 1



[stepper_y] # SLOT M6
step_pin: PE0
dir_pin: PG3
enable_pin: !PG4
rotation_distance: 40
microsteps: 32
full_steps_per_rotation: 400  


endstop_pin: PG10
position_endstop: 0
position_min: 0
position_max: 505
homing_speed: 200 
homing_retract_dist: 50

[tmc5160 stepper_y] 
cs_pin: PG2
interpolate: false
run_current: 1.9
sense_resistor: 0.033
spi_software_mosi_pin: PB5
spi_software_miso_pin: PB4
spi_software_sclk_pin: PB3
driver_TBL: 2
driver_TOFF: 4
driver_DISS2G: 1
driver_DISS2VS: 1



[stepper_y1] # SLOT M4
step_pin: PE15
dir_pin: PE11
enable_pin: !PF2
rotation_distance: 40
microsteps: 32
full_steps_per_rotation: 400

[tmc5160 stepper_y1]
cs_pin: PE10
interpolate: false
run_current: 1.9
sense_resistor: 0.033
spi_software_mosi_pin: PB5
spi_software_miso_pin: PB4
spi_software_sclk_pin: PB3
driver_TBL: 2
driver_TOFF: 4
driver_DISS2G: 1
driver_DISS2VS: 1


#########################

# Z-Axis with Three Motors

[stepper_z]
## In M0 position
step_pin: PE2
dir_pin: !PC5
enable_pin: !PF11


microsteps: 32
rotation_distance: 4
position_max: 1000
full_steps_per_rotation: 400
homing_retract_dist: 5.0
homing_positive_dir: false
homing_speed: 5.0
second_homing_speed: 2.5
endstop_pin: probe:z_virtual_endstop # uses cartographer as virtual endstop
homing_retract_dist: 0 # cartographer needs this to be set to 0

[tmc2208 stepper_z]
uart_pin: PC4
run_current: 1.2
sense_resistor: 0.110
interpolate: false



[safe_z_home]
home_xy_position: 250,250
z_hop: 10

[stepper_z1]
step_pin: PE3   # Slot 1 step pin
dir_pin: PF13   # Direction pin
enable_pin: !PF14  # Enable pin
microsteps: 32
rotation_distance: 4
full_steps_per_rotation: 400

[tmc2208 stepper_z1]
uart_pin: PF12
run_current: 1.2
sense_resistor: 0.110
interpolate: false

[stepper_z2]
step_pin: PE4   # Slot 2 step pin
dir_pin: !PG0    # Direction pin
enable_pin: !PG1  # Enable pin
microsteps: 32
rotation_distance: 4
full_steps_per_rotation: 400

[tmc2208 stepper_z2]
uart_pin: PF15
run_current: 1.2
sense_resistor: 0.110
interpolate: false

# Extruder Motor (Slot 7)

[extruder]

step_pin: PE6
dir_pin: !PG6
enable_pin: !PG7


microsteps: 16
#Alu VZhextrudort Moons 8T
#rotation_distance: 22.2
#Gear_ratio: 50:8
#Alu VZhextrudort Moons 10T
rotation_distance: 22 
gear_ratio: 50:10 
#VZHextrudort LDO 20mm
#rotation_distance: 4.71
nozzle_diameter: 0.4
filament_diameter: 1.750

heater_pin: PB0
sensor_type: PT1000
sensor_pin: PF4

#control: pid
#pid_Kp: 28.737 
#pid_Ki: 1.935 
#pid_Kd: 106.684
min_temp: -200
max_temp: 40000000000
full_steps_per_rotation: 200
max_extrude_only_distance: 1000.0
max_extrude_cross_section: 500
max_extrude_only_velocity: 200
max_extrude_only_accel: 10000
min_extrude_temp: 0
pressure_advance: 0.02
pressure_advance_smooth_time: 0.03

[tmc2208 extruder]
uart_pin: PG5
run_current: 0.7
sense_resistor: 0.110
interpolate: false


[heater_bed]
heater_pin: PE5
sensor_pin: PC1
sensor_type: Generic 3950
max_power: 1.0
control: pid
pid_kp: 70.0
pid_ki: 1.0
pid_kd: 570
min_temp: -220
max_temp: 12000000000


[temperature_sensor Chamber]
sensor_pin: PF5  # Temperature sensor pin for the bed
sensor_type: Generic 3950

[temperature_sensor Electronics-Bay]
sensor_pin: PF9  # Temperature sensor pin for the bed
sensor_type: Generic 3950


[temperature_sensor FLY-8-PRO]
sensor_type: temperature_mcu
min_temp: -50
max_temp: 200

#[mcu rpi]
#serial: /tmp/klipper_host_mcu

[temperature_sensor Raspberry-Pi]
sensor_type: temperature_host
min_temp: -50
max_temp: 200

# Optional Chamber Heater SSR (Add when ready)

